export const calculateCoursePrice = async (course) => {
  console.log(course);

  return await fetch("http://192.168.1.60:5000/api/course/price", {
    method: "POST",
    body: JSON.stringify(course),
    // headers: {
    //   "Content-Type": "application/json",
    // },
  })
    .then((res) => res.json())
    .then((res) => res.price)
    .catch(err => console.log(err))
};
